function displayData(arr) {
  document.getElementById("data").innerHTML = "";

  arr.forEach((product, index) => {
    let row = document.createElement("tr");

    let numberTD = document.createElement("td");
    numberTD.innerText = index + 1;

    let nameTD = document.createElement("td");
    nameTD.innerText = product.name;
    let priceTD = document.createElement("td");
    priceTD.innerText = product.price;

    let categoryTD = document.createElement("td");
    categoryTD.innerText = product.category;

    let quantityTD = document.createElement("td");
    quantityTD.innerText = product.quantity;

    let picTD = document.createElement("td");
    let proPic = document.createElement("img");
    proPic.setAttribute("src", product.pic);
    proPic.style.width = "50px"; // Adjust size as needed
    proPic.style.height = "50px"; // Adjust size as needed

    picTD.appendChild(proPic);

    row.append(numberTD, nameTD, priceTD, categoryTD, quantityTD, picTD);
    document.getElementById("data").appendChild(row);
  });
}

displayData(products);

// Side bar logic

let filterStatus = false;
function openFilterSection() {
  if (filterStatus === false) {
    document.getElementById("filter_box").style.marginLeft = "0px";
    displayData(products);

    filterStatus = true;
  } else {
    document.getElementById("filter_box").style.marginLeft = "-30%";
    displayData(products);

    filterStatus = false;
  }
}

//  filter:

let filters = {
  category: null,
  quantity: null,
  minPrice: null,
  maxPrice: null,
};

function setFilters(property, value) {
  if (value !== "") {
    filters[property] = value;
    if (property === "minPrice") {
      document.getElementById("maxPrice").min = Number(value) + 1;
      document.getElementById("lowMaxPriceLabel").innerText = Number(value) + 1;
    }
    if (document.getElementById("auto_filter").checked === true) {
      filter();
    }
  } else {
    filters[property] = null;
  }
  console.log(filters);
}

function filter() {
  let filterdData = products;
  if (filters.category !== null) {
    filterdData = filterdData.filter((product, ind) => {
      return product.category.toLowerCase() === filters.category.toLowerCase();
    });
  }

  if (filters.quantity !== null) {
    filterdData = filterdData.filter((product, ind) => {
      return product.quantity >= Number(filters.quantity);
    });
  }

  if (filters.minPrice !== null) {
    filterdData = filterdData.filter((product, ind) => {
      return product.price >= Number(filters.minPrice);
    });
  }

  if (filters.maxPrice !== null) {
    filterdData = filterdData.filter((product, ind) => {
      return product.price <= Number(filters.maxPrice);
    });
  }
  // console.log(filterdData);

  displayData(filterdData);
}
